          <BoardItems />
        </div>
        <div className="wrap-board-items">
          <BoardItems />
        </div>
        <div className="wrap-board-items">
          <BoardItems />
        </div>
        <div className="wrap-board-items">
          <BoardItems />
        </div>
        <div className="wrap-board-items">
          <BoardItems />
        </div>
        <div className="wrap-board-items">
          <BoardItems />
        </div>
        <div className="wrap-board-items">
          <i className="fa fa-plus-square"></i>
          <div className="message">
            <span>{t("text.createNewBoard", number)}</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default React.memo(ListBoardItems);
